import { Component } from '@angular/core';
import { NgForm } from '@angular/forms';
import { HttpClient } from '@angular/common/http';

@Component({
  selector: 'app-admin-registration',
  templateUrl: './admin-registration.component.html',
  styleUrls: ['./admin-registration.component.css']
})
export class AdminRegistrationComponent {
  admin = { email: '', password: '' };

  constructor(private http: HttpClient) {}

  onSubmit() {
    this.http.post('http://localhost:3000/admin/register', this.admin).subscribe((response) => {
      console.log('Admin registration successful');
    }, (error) => {
      console.error('Admin registration failed', error);
    });
  }
}
<p>admin-registration works!</p>
<h2>Admin Registration</h2>
<form (ngSubmit)="onSubmit()" #adminRegistrationForm="ngForm">
  <label>
    Email:
    <input type="email" name="email" [(ngModel)]="admin.email" required>
  </label>
  <br>
  <label>
    Password:
    <input type="password" name="password" [(ngModel)]="admin.password" required>
  </label>
  <br>
  <button type="submit">Submit</button>
</form>
